import React, {Component} from "react";
import Increment_button from "./Increment_button.jsx";

export default class New_component extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        const groceries = [
            {item: "milk"},
            {item: "eggs"},
            {item: "carrots"},
            {item: "cheese"}
        ];

        return(
            groceries.map((item) =>
                <div>
                    <div>
                        <h1>{item.item} </h1>
                        <Increment_button name={item.item}> </Increment_button>
                    </div>
                </div>
            )
            // <h1> hello </h1>
            //
            // <div>
            //     <Increment_button> </Increment_button>
            // </div>
        );
    }
}
